import React from 'react';

const EmployeeDashboard = () => {
  return (
    <div>
      <h1>Anställdas översikt</h1>
      <p>Välkommen [Användarnamn]!</p>
      <img src="path/to/profile-image" alt="Profilbild" />
      <p>Här kan du se dina arbetsordrar, rapportera tid och läsa meddelanden.</p>
    </div>
  );
};

export default EmployeeDashboard;
